    return(
        <>
        <div className="four">
        <span className="countdown cd">
        <span style={{"--value":55}}></span>
            </span>
        <Left path="#slide3"></Left>
            <Right path="#slide5"></Right>
            <center>
                {/* first text starts */}
                <div className="fourth">
                <img className="img-four" src="https://source.unsplash.com/random" width="30%"></img>
                <p className="sec-para text-2xl">Js was Your Favorite Language</p>
                </div>
            </center>
       
        </div>
        
        </>
    )
}
export default Four;
